import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
// import store from './redux/store'
import { Provider } from 'react-redux'
import { createStore, applyMiddleware } from 'redux'
import cityReducer from './redux/reducers/cityReducer'
import thunk from 'redux-thunk'
import initialState from './redux/reducers/cityReducer'

// export const store = createStore(cityReducer, window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__())

export const store = createStore(cityReducer, applyMiddleware(thunk))

export default store
ReactDOM.render(<Provider store={store}><App /></Provider>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
